import React from 'react'
import styled from "styled-components";

const StyledLi = styled.li`
    list-style: none;
    padding: .75rem 1.25rem;
    border-bottom: 1px solid rgba(0,0,0,.125);
    border-color: white;
    color: white;
    &:last-of-type {
      border-bottom: none;
    }
    &:hover {
      background: rgb(6,6,6);
      background: linear-gradient(90deg, rgba(6,6,6,1) 0%, rgba(13,13,226,1) 50%, rgba(6,6,6,1) 100%);
      transition-duration: .5s;
    }
`;

const StyledUl = styled.ul`
  padding: 0;
  border-radius: 5px;
  border: 1px solid white;
`;

const TodoList = ({data}) => {

    return (
        <div>
            <StyledUl>
                {data.map(({label, id}) => {
                    return (
                            <StyledLi key = {id}>
                                {label}
                            </StyledLi>
                        )
                })}

            </StyledUl>
        </div>
    )
};

export default TodoList;
